package com.csejnu.diary.Model;public class Faculty {    String id, uid, name, onushod, title, dept, number_home, number_office, email, fax, fav;    public Faculty(String uid, String name, String onushod, String title, String dept, String number_home, String number_office, String email, String fax, String fav) {        this.uid = uid;        this.name = name;        this.onushod = onushod;        this.title = title;        this.dept = dept;        this.number_home = number_home;        this.number_office = number_office;        this.email = email;        this.fax = fax;        this.fav = fav;    }    public String getId() {        return id;    }    public void setId(String id) {        this.id = id;    }    public Faculty() {    }    public String getFav() {        return fav;    }    public void setFav(String fav) {        this.fav = fav;    }    public String getUid() {        return uid;    }    public void setUid(String uid) {        this.uid = uid;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getOnushod() {        return onushod;    }    public void setOnushod(String onushod) {        this.onushod = onushod;    }    public String getTitle() {        return title;    }    public void setTitle(String title) {        this.title = title;    }    public String getDept() {        return dept;    }    public void setDept(String dept) {        this.dept = dept;    }    public String getNumber_home() {        return number_home;    }    public void setNumber_home(String number_home) {        this.number_home = number_home;    }    public String getNumber_office() {        return number_office;    }    public void setNumber_office(String number_office) {        this.number_office = number_office;    }    public String getEmail() {        return email;    }    public void setEmail(String email) {        this.email = email;    }    public String getFax() {        return fax;    }    public void setFax(String fax) {        this.fax = fax;    }}